Como, in zona residenziale, vendiamo villa d'epoca costruita nel 1925, disposta su tre livelli:
piano terra: lavanderia, ripostiglio e una cantina;
primo piano: soggiorno, salotto, cucina abitabile, una camera da letto, un bagno, un ripostiglio e un balcone;
secondo piano: soggiorno, due camere da letto, un bagno, un cucinino e un balcone. Giardino di 3.860 mq con edificabilità di 1.340 mq. Riscaldamento autonomo.

