Brunate (CO), Vendiamo villa moderna ultimata nel 2005 completamente nuova e costruita con i principi della bioarchitettura, isolamento termico con relativa diminuzione della dispersione termica. Tutti i piani sono indipendenti poichè hanno tutti un regolatore termico indipendente e tutte predisposizioni elettriche permettendo di dividere la casa anche in tre appartamenti indipendenti. Costruita sulla roccia e scavata. La villa ha una metratura di 300 mq, terreno di 1.800 mq di cui 350 mq edificabili. La villa è composta da:
piano terra: ampia sala con camino (se si vuole si può ricavare l'angolo cucina già predisposto), camera da letto, bagno con doccia;
piano primo: due ingressi con porte blindate, soggiorno/pranzo (con camino con sistema che permette di riscaldare la casa) cucina, camera da letto con terrazzo, bagno con doccia idromassaggio, guardaroba lavanderia;
piano secondo mansardato: camera da letto, bagno con vasca/doccia, stanza con camino (già predisposta per fare la cucina). Ripostiglio esterno con locale caldaia.
Box singolo (esiste un progetto per farlo più grande), posto auto, sistema di allarme, predisposizione video-allarme, cisterne per acqua piovana, tutto il perimetro della casa ha vespaio con un angolo lavandino con acqua potabile calda/fredda.

Annuncio.Descrizione_En:
Brunate (CO), sell modern villa was completed in 2005 and built completely new with the principles of ecological design, with a relative decrease of the thermal insulation and heat loss. All plans are independent because they all have a thermal regulator independent, allowing all electrical arrangements to divide the house in three separate apartments. Built on the rock and dug. The villa has a floor area of 300 square meters, land of 1,800 square meters of which 350 sq m building. The villa consists of:
Ground floor: large living room with fireplace (if you want you can get the kitchen already prepared), bedroom, bathroom with shower;
first floor: two entrances with doors, living room / dining room (with fireplace system that allows you to heat the house) kitchen, bedroom with balcony, bathroom with shower, laundry guardarobam;
second floor attic: bedroom, bathroom with bath / shower room with fireplace (ready to do the cooking). Outside storage with a boiler room.
Single garage (there is a project to make it bigger), parking, alarm system, preparing video alarm, rainwater tanks, around the perimeter of the house crawl space with a corner sink with hot water / cold water.
